"use strict";(self.webpackChunkhowldocs=self.webpackChunkhowldocs||[]).push([[1477],{10:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"public-beta-debrief","metadata":{"permalink":"/blog/public-beta-debrief","editUrl":"https://github.com/howlsocial/howldocs/tree/main/docs/blog/2022-09-14-public-beta-debrief.md","source":"@site/blog/2022-09-14-public-beta-debrief.md","title":"Public Beta Debrief","description":"If you took part in our Beta test, then thank you!","date":"2022-09-14T00:00:00.000Z","formattedDate":"September 14, 2022","tags":[{"label":"beta","permalink":"/blog/tags/beta"},{"label":"testing","permalink":"/blog/tags/testing"}],"readingTime":0.78,"hasTruncateMarker":false,"authors":[{"name":"the frey","title":"Co-founder","url":"https://github.com/the-frey","imageURL":"https://github.com/the-frey.png","key":"frey"}],"frontMatter":{"slug":"public-beta-debrief","title":"Public Beta Debrief","authors":"frey","tags":["beta","testing"]},"nextItem":{"title":"Public Beta Challenges","permalink":"/blog/public-beta-challenges"}},"content":"If you took part in our Beta test, then thank you!\\n\\nWithout all our testers, getting to mainnet would be taking us a lot longer.\\n\\nWe were blown away by the scale of response - thanks to everybody that had feedback, feature suggestions or helped out in some way.\\n\\nAgain, like last time, we have some numbers.\\n\\n- 9.42k unique users took part in the testnet\\n- 1,538,091 HOWLx (testnet HOWL) was claimed\\n- All our documentation challenges were completed\\n\\nHowever, this time there were also some snags - which makes sense, as we get closer to mainnet.\\n\\n- 2 severity 1 bugs\\n- 8 minor bugs\\n\\nSo what does this mean?\\n\\nWell, we have some windows to mend, and then we will run either a closed Beta2 net, or a final open test before we go to mainnet.\\n\\nThis has pushed our timings back by a couple of weeks, but not by a massive amount."},{"id":"public-beta-challenges","metadata":{"permalink":"/blog/public-beta-challenges","editUrl":"https://github.com/howlsocial/howldocs/tree/main/docs/blog/2022-09-06-public-beta-challenges.md","source":"@site/blog/2022-09-06-public-beta-challenges.md","title":"Public Beta Challenges","description":"Here are the $HOWL public beta challenges!","date":"2022-09-06T00:00:00.000Z","formattedDate":"September 6, 2022","tags":[{"label":"beta","permalink":"/blog/tags/beta"},{"label":"testing","permalink":"/blog/tags/testing"}],"readingTime":2.585,"hasTruncateMarker":false,"authors":[{"name":"the frey","title":"Co-founder","url":"https://github.com/the-frey","imageURL":"https://github.com/the-frey.png","key":"frey"},{"name":"aswever","title":"Co-founder","url":"https://github.com/aswever","imageURL":"https://github.com/aswever.png","key":"aswever"},{"name":"callum","title":"Co-founder","url":"https://github.com/callum-a","imageURL":"https://github.com/callum-a.png","key":"callum"}],"frontMatter":{"slug":"public-beta-challenges","title":"Public Beta Challenges","authors":["frey","aswever","callum"],"tags":["beta","testing"]},"prevItem":{"title":"Public Beta Debrief","permalink":"/blog/public-beta-debrief"},"nextItem":{"title":"Public Alpha Debrief","permalink":"/blog/public-alpha-debrief"}},"content":"Here are the $HOWL public beta challenges!\\n\\n**All challenges start after claim begins. This is targeted for Wednesday 7th September (2022-09-08) at 0900UTC.**\\n\\n**All challenges end on Wednesday 14th September (2022-09-12) at 1300UTC.**\\n\\n**For challenge 1.1. YOU NEED TO ALREADY BE IN THE AIRDROP TO BE ELIGIBLE**. To check this, go to the airdrop claim site. You should be able to see `<your-address> can claim X HOWL` after connecting your wallet. If you are not eligible, you will see `<your-address> was not eligible for the Howl airdrop`.\\n\\nSome challenges will require the team to calculate who won, so winners may not be announced for several days afterward.\\n\\n## Check eligibility and claim\\n\\nUse the [Airdrop claim tool](https://testnet-claim.howl.social/) to check your eligibility and claim.\\n\\n## Challenges\\n\\nThe challenges are:\\n\\n1. ***Posting Challenge*** for Howl Genesis users:\\n    1. For every HOWL post you make, you will be awarded 1:1 additional HOWL tokens up to 50 extra tokens.\\n        1. i.e. if you already are eligible for 50 HOWL, you can earn 50 more, for a total of 100.\\n        2. **NOTE:** *only addresses already in the airdrop are eligible for the additional HOWL*[0]\\n2. ***Documentation***. Submit a pull-request with your guide to https://github.com/howlsocial/howldocs in order to claim these bounties[1]:\\n    1. Getting started with HOWL guides (only 1 guide needs writing for each):\\n        1. **Claiming:** ~~How to claim your airdrop - Accepted PR = 500 HOWL~~ **CLAIMED**\\n        2. **Create user:** ~~Create a DENS name, set a primary alias. Include how to update and burn if necessary - Accepted PR = 1k HOWL~~ **CLAIMED**\\n        3. **Connecting:** ~~Connect wallet to HOWL, connect DENS alias, add HOWL contract to Keplr - Accepted PR = 1k HOWL~~ **CLAIMED**\\n        4. **Posting and staking**: ~~how to create a post, how to stake to others\u2019 posts - Accepted PR = 1k HOWL~~ **CLAIMED**\\n        5. **Find users to follow:** ~~how to find users, navigate hashtags and reply to posts - Accepted PR = 1k HOWL~~ **CLAIMED**\\n        6. **DAOs:** ~~How to post as a DAO, how to reference DAO props etc within HOWL - Accepted PR = 1k HOWL~~ **CLAIMED**\\n        7. **Howl Pay:** ~~How to send one-off payments. How to subscribe, how to see your subscribers and those you are paying - Accepted PR = 1k HOWL~~ **CLAIMED**\\n\\nNotes on challenges:\\n\\n- [0] once again - this is only open to users already eligible for the airdrop. If you\u2019re not eligible, you will earn nothing by posting, though you\u2019re welcome to try the app and help us test :)\\n- [1] note that a bounty will only be paid on an accepted pull-request. For now we\u2019re looking for guides in English, and there may be future bounties for translations of those, once we have high-quality guides. _ONLY ONE BOUNTY WILL BE PAID FOR EACH GUIDE_.\\n\\n## Bug Bounties\\n\\nAs in the Public Alpha, the Howl team reserve the right to offer discretionary bounties for:\\n\\n- Bugs (~2k HOWL available for serious bugs)\\n- Exploits (~4k HOWL available for an exploit)\\n- Social engineering of the DAO\\n\\nTo report a bug or an exploit you\u2019ve found, use the `public-beta-bugs` channel on Discord."},{"id":"public-alpha-debrief","metadata":{"permalink":"/blog/public-alpha-debrief","editUrl":"https://github.com/howlsocial/howldocs/tree/main/docs/blog/2022-08-30-public-alpha-debrief.md","source":"@site/blog/2022-08-30-public-alpha-debrief.md","title":"Public Alpha Debrief","description":"Thanks to everybody that took part in the Public Alpha.","date":"2022-08-30T00:00:00.000Z","formattedDate":"August 30, 2022","tags":[{"label":"alpha","permalink":"/blog/tags/alpha"},{"label":"testing","permalink":"/blog/tags/testing"}],"readingTime":0.475,"hasTruncateMarker":false,"authors":[{"name":"the frey","title":"Co-founder","url":"https://github.com/the-frey","imageURL":"https://github.com/the-frey.png","key":"frey"}],"frontMatter":{"slug":"public-alpha-debrief","title":"Public Alpha Debrief","authors":"frey","tags":["alpha","testing"]},"prevItem":{"title":"Public Beta Challenges","permalink":"/blog/public-beta-challenges"}},"content":"Thanks to everybody that took part in the Public Alpha.\\n\\nWe got lots of actionable feedback, and have been busy working on new features ready for mainnet - we\'ll have some news on that soon.\\n\\nSome high-level numbers, for the curious:\\n\\n- 1,061 users took part in the challenges\\n- 6/11 ended up being claimed or completed\\n- 20,500 $HOWL in rewards were claimed\\n\\nSince then, we\'ve been getting ready for some final testing and kicking the tyres on the final application.\\n\\nWe\'re super stoked to share what we\'ve been working on with you all!"}]}')}}]);